import React from 'react'
import './CSS/Knives.css'
import all_knives from '../Components/Assets/all_knifes'
import Knife from '../Knife/Knife'

export const Knives = () => {
  return (
    <div className='trending'>
    <h1>Trending Knives</h1>
    <div className='trending-item'>
      {all_knives.map((item, i)=>{
        return <Knife key={i} id={item.id} name={item.name} image={item.image} price={item.knife_price}/>
      })}
    </div>

  </div>
  )
}
